import React from "react";
import "./index.css"
var imgsrc ="";
var title ="";
var link = "";
let cardname ="";

function card(props){
    return (
        <div className="cont">
        <div className="cards">
            <div className="card">
                <img src={props.imgsrc} alt="my pic" className="card_img" />
                <div className="card_info">
                    <span className="card_category">{props.cardname}</span>
                    <h3 className="card_title">{props.title}</h3>
                    <a href={props.link} target="_blank">
                        <button>Watch Now</button>
                    </a>
                </div>
            </div>
        </div>
    </div>
    )
}
export default card;
